		//       content.load(function(){
		//         content.show();
		//         content2.hide();//animate({opacity:0.0},500,function(){content2.hide()});
		//       });
		//       content.attr("src",photoUrl);
		//       content.attr("alt",photoAlt);
		//       divider.append(creditDiv);

		// 	  //Dummy image, medium
		//       var content2 = $('<img src=' +
		//       '"data:image/gif;base64,"'
